import React from 'react'
import '../../App.css';

export default class  ManualPage extends React.Component{

    constructor(props) {
        super(props);
        this.state = {page_id: props.page_id, submenu_id: props.submenu_id};
      }


    render() {
        return (
            <div class="main">
                <embed src="https://zerodebug.com/touchable/touchAbleProManual.pdf" width="500" height="375"  type="application/pdf"></embed>
                <iframe src="http://docs.google.com/gview?url=http://example.com/mypdf.pdf&embedded=true" style="width:718px; height:700px;" frameborder="0"></iframe>

            </div>
        );
}
}
